class NameText extends Component {
    state = { name:"Allax", surname:"Buddovich" };
    render() { 
        return (
            <span className="name">
                &gt;&nsbp;{this.state.name}&nsbp;{this.state.surname}<span className="textCursor">_</span>
                </span>
        );
    }
}
 
export default NameText;
